      <a href="https://www.linkedin.com/in/matthew-kinzle-3aa07568/" className="fa fa-linkedin text-muted footer-links" target="_blank">LinkedIn</a>
      <a href="https://www.instagram.com/kinzito/" className="fa fa-instagram text-muted footer-links" target="_blank">Instagram</a>

      <span className="text-muted footer-links">MattyKinzle.com Â©</span>

    </footer>
  );
}

export default Footer;
